INSERT INTO value_set_category 
VALUES (1,'2014-04-01 06:28:24','2014-04-01 05:09:00','demo.sysadmin','ETH','Drug abuse information sensitivity','Drug abuse is a patterned use of a substance (drug) in which the user consumes the substance in amounts or with methods neither approved nor advised by medical professionals. Substance abuse/drug abuse is not limited to mood-altering or psycho-active drugs. If an activity is performed using the objects against the rules and policies of the matter (as in steroids for performance enhancement in sports), it is also called substance abuse. Therefore, mood-altering and psychoactive substances are not the only types of drugs abused. Using illicit drugs \\u2013 narcotics, stimulants, depressants (sedatives), hallucinogens, cannabis, even glues and paints, are also considered to be classified as drug/substance abuse.')
		,(2,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','GDIS','Genetic disease information sensitivity','A genetic disorder is an illness caused by one or more abnormalities in the genome, especially a condition that is present from birth (congenital). Most genetic disorders are quite rare and affect one person in every several thousands or millions. Genetic disorders are heritable, and are passed down from the parents'' genes. Other defects may be caused by new mutations or changes to the DNA. In such cases, the defect will only be heritable if it occurs in the gene line. The same disease, such as some forms of cancer, may be caused by an inherited genetic condition in some people, by new mutations in other people, and by nongenetic causes in still other people.')
		,(3,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','HIV','HIV/AIDS information sensitivity','Human immunodeficiency virus infection / acquired immunodeficiency syndrome (HIV/AIDS) is a disease of the human immune system caused by infection with human immunodeficiency virus (HIV). During the initial infection, a person may experience a brief period of influenza-like illness. This is typically followed by a prolonged period without symptoms. As the illness progresses, it interferes more and more with the immune system, making the person much more likely to get infections, including opportunistic infections and tumors that do not usually affect people who have working immune systems.')
		,(4,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','PSY','Psychiatry information sensitivity','A mental disorder or psychiatric disorder is a psychological pattern or anomaly, potentially reflected in behavior, that is generally associated with distress or disability, and which is not considered part of normal development in a person''s culture. Mental disorders are generally defined by a combination of how a person feels, acts, thinks or perceives. This may be associated with particular regions or functions of the brain or rest of the nervous system, often in a social context.')
		,(6,'2014-04-01 06:28:24','2014-04-01 06:28:24','sysadmin','SEX','Sexuality and reproductive health information sensitivity','Human sexuality is the capacity to have erotic experiences and responses. Human sexuality can also refer to the way someone is sexually attracted to another person \\u2013 which is determined by their sexual orientation \\u2013 whether it is to the opposite sex (heterosexuality), to the same sex (homosexuality), having both these tendencies (bisexuality), to all gender identities (pansexuality or bisexuality), or not being attracted to anyone in a sexual manner (asexuality). Human sexuality impacts cultural, political, legal, and philosophical aspects of life. It can refer to issues of morality, ethics, theology, spirituality, or religion. Some cultures have been described as sexually repressive. Within the framework of the World Health Organization''s (WHO) definition of health as a state of complete physical, mental and social well-being, and not merely the absence of disease or infirmity, reproductive health, or sexual health/hygiene, addresses the reproductive processes, functions and system at all stages of life. Reproductive health, therefore, implies that people are able to have a responsible, satisfying and safer sex life and that they have the capability to reproduce and the freedom to decide if, when and how often to do so. One interpretation of this implies that men and women ought to be informed of and to have access to safe, effective, affordable and acceptable methods of birth control; also access to appropriate health care services of sexual, reproductive medicine and implementation of health education programs to stress the importance of women to go safely through pregnancy and childbirth could provide couples with the best chance of having a healthy infant. On the other hand individuals do face inequalities in reproductive health services. Inequalities vary based on socioeconomic status, education level, age, ethnicity, religion, and resources available in their environment. It is possible for example, that low income individuals lack the resources for appropriate health services and the knowledge to know what is appropriate for maintaining reproductive health.')
		,(9,'2014-04-01 05:14:20','2014-04-01 05:18:51','demo.sysadmin','ALC','Alcohol Abuse and Alcoholism Information','Alcohol abuse and Alcoholism (alcohol dependence) are two different forms of problem drinking.  Alcohol abuse is when an individualâs drinking leads to problems, but not physical addiction.  Alcoholism is when an individual has signs of physical addiction to alcohol and continues to drink, despite problems with physical health, mental health, and social, family, or job responsibilities. ');		
		
